import React, { useState } from 'react';
import SquareButton from '../../components/Buttons/SquareButton';
import "./main_style.css"

const gen_img = require('./planta.jpg')
enum Page{
    None,First,Second,Third,Fourth
}

function Main(){
    let [page,set_page] = useState(Page.None)
    let this_func1 = ()=>{
        set_page(Page.First)
        console.log("First button has been clicked"+page)
    }
    let this_func2 = ()=>{
        set_page(Page.Second)
        console.log("Second button has been clicked")
    }
    let this_func3 = ()=>{
        set_page(Page.Third)
        console.log("Third button has been clicked")
    }
    let this_func4 = ()=>{
        set_page(Page.Fourth)
        console.log("Forth button has been clicked")
    }
    return <div className='main-page'>
        <SquareButton img_src={gen_img} title={"First button"} on_click_action={this_func1}></SquareButton>
        <SquareButton img_src={gen_img} title={"Second button"} on_click_action={this_func2}></SquareButton>
        <SquareButton img_src={gen_img} title={"Third button"} on_click_action={this_func3}></SquareButton>
        <SquareButton img_src={gen_img} title={"Forth button"} on_click_action={this_func4}></SquareButton>
    </div>
}

export default Main;
